DROP TABLE IF EXISTS `productos`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
 SET character_set_client = utf8mb4 ;
CREATE TABLE `productos` (
  `codigoProducto` int(11) NOT NULL AUTO_INCREMENT,
  `nombreProducto` varchar(150) NOT NULL,
  `descProductos` varchar(150) NOT NULL,
  `marca` varchar(150) NOT NULL,
  `precio` decimal(10,2) NOT NULL,
  `talla` int(11) NOT NULL,
  `cantidad` int(11) NOT NULL,
  `fotoDeProductos` longblob,
  `codigoProveedor` int(11) NOT NULL,
  `codigoCategoria` int(11) NOT NULL,
  PRIMARY KEY (`codigoProducto`),
  KEY `FK_Productos_Proveedores` (`codigoProveedor`),
